import React from 'react';
import MonthlyChart from './chart.js';

const data = [
    { month: 'Jan', usage: 40, amount: 20 },
    { month: 'Feb', usage: 48, amount: 24 },
    { month: 'Mar', usage: 52, amount: 26 },
    { month: 'Apr', usage: 45, amount: 22.5 },
    { month: 'May', usage: 60, amount: 30 },
    { month: 'Jun', usage: 70, amount: 35 },
];

const App = () => {
    return (
        <div>
            <h1>Monthly Water Consumption and Bill</h1>
            <MonthlyChart data={data} />
        </div>
    );
};

export default App;
